import React from "react";

function reverse(str){
  var reversed = "";
  for (let i = str.length - 1; i >= 0; i--){
    reversed += str[i];
  }
  return reversed;
}

var letters = {};
function getCharCounts(str) {
  str.replace(/\S/g, function(l){letters[l] = (isNaN(letters[l]) ? 1 : letters[l] + 1);});
  return letters;
}

var array = Object.keys(letters);

function unique(letters){
  for(let i = 0; i < array.length; i++) {
    return Object.entries(letters)[i];
  }
}

const Bubble = (props) => {
  console.log(getCharCounts(props.inputstring));
  return(
    <div className="bubble-container">
      <p>string: {props.inputstring}</p>
      <p>reversed string: {reverse(props.inputstring)}</p>
      <div>unique char count: {unique(getCharCounts(props.inputstring))}</div>
		</div>
  );
}

export default Bubble;
